INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (67, 'mensaje conocimiento', 'SabÃ­as que si realizas cambios a tu dieta, empiezas a hacer ejercicio y buscas mÃ©todos para manejar el estrÃ©s y buscar la relajaciÃ³n se disminuirÃ¡n tus Ã­ndices de hemoglobina glicosilada. ', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (39, 'mensaje conocimiento', 'SabÃ­as que La Diabetes es una enfermedad del pÃ¡ncreas que es un Ã³rgano ubicado detrÃ¡s de tu estÃ³mago. Normalmente, el pÃ¡ncreas libera en la sangre una sustancia llamada insulina. La Insulina ayuda a que el cuerpo use azÃºcares y grasas provenientes de los alimentos que comemos. Cuando una persona tiene diabetes, el pÃ¡ncreas: No produce insulina o produce solo un poco de insulina o produce insulina pero Ã©sta no trabaja como deberÃ­a.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (40, 'mensaje conocimiento', 'SabÃ­as que no es claro cuÃ¡l es la causa de la diabetes pero una historia familiar de diabetes, tener sobrepeso, la edad (los riesgos se incrementan con los aÃ±os), y el consumo de ciertas medicinas pueden incrementar el riesgo de sufrir de diabetes.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (41, 'mensaje conocimiento', 'SabÃ­as que los sÃ­ntomas de la diabetes Tipo 2 frecuentemente no son notorios. Estos sÃ­ntomas se construyen con el tiempo e incluyen: VisiÃ³n borrosa, demora en la cauterizaciÃ³n de cortes y heridas, comezÃ³n en la piel, infecciÃ³n vaginal por levaduras, incremento de la sed, boca seca, necesidad frecuente de orinar, pÃ©rdida de peso e infecciones recurrentes.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (42, 'mensaje conocimiento', 'SabÃ­as que existen dos tipos de diabetes: Tipo 1 y Tipo 2. La Diabetes Tipo 1 ocurre con mÃ¡s frecuencia en personas que tienen menos de 30 aÃ±os de edad. El pÃ¡ncreas produce poca o nada de insulina. y la Diabetes Tipo 2 ocurre con mayor frecuencia en personas mayores de 40 aÃ±os de edad y con sobrepeso. En el caso de la insulina es producida pero no trabaja como deberÃ­a.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (43, 'mensaje conocimiento', 'SabÃ­as que la diabetes es controlada a travÃ©s de una dieta apropiada, ejercicio y, si es necesario, medicamentos. Las personas con diabetes deben realizarse exÃ¡menes en la casa y en la oficina para monitorear los niveles de azÃºcar, colesterol y triglicÃ©ridos (un tipo de grasa) en su sangre. ', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (44, 'mensaje conocimiento', 'SabÃ­as que aÃºn no se ha encontrado una cura para la diabetes. Sin embargo, la diabetes puede ser tratada y controlada. La mayorÃ­a de las personas manejan su enfermedad y llevan vidas normales. ', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (45, 'mensaje conocimiento', 'SabÃ­as que el tabaco causa resistencia insulÃ­nica comparable a la ocasionada por la obesidad central. Entre los efectos adversos del tabaquismo la  patologÃ­a arteriosclerÃ³tica, pero tambiÃ©n participa y empeora el curso evolutivo de las complicaciones microvasculares (retinopatÃ­a y nefropatÃ­a).', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (46, 'mensaje conocimiento', 'SabÃ­as que la obesidad conlleva un aumento del riesgo cardiovascular y constituye el llamado sÃ­ndrome plurimetabÃ³lico. El origen de este sÃ­ndrome probablemente es la presencia de una resistencia a la insulina en tejido adiposo, hepÃ¡tico y muscular.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (47, 'mensaje conocimiento', 'SabÃ­as que la Diabetes Mellitus 2 afecta a los ojos, riÃ±ones, nervios, corazÃ³n y vasos sanguÃ­neos.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (48, 'mensaje conocimiento', 'SabÃ­as que sin un cuidado apropiado, la diabetes puede conllevar a enfermedades del corazÃ³n, enfermedades de los riÃ±ones, presiÃ³n sanguÃ­nea alta o baja, deterioro de la vista y ceguera, enfermedad de las encÃ­as, infecciones serias en los pies, algunas veces requieren amputaciÃ³n y daÃ±o a los nervios, resultando en dolor o pÃ©rdida de la sensaciÃ³n.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (49, 'mensaje conocimiento', 'SabÃ­as que la pÃ©rdida de peso en diabÃ©ticos tipo 2 se asocia con un incremento de la esperanza de vida, una mejora de los factores de riesgo cardiovascular (hipertensiÃ³n, dislipemia) y del control glucÃ©mico.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (50, 'mensaje conocimiento', 'SabÃ­as que la mayorÃ­a de las personas tienen sÃ­ntomas de hipoglucemia, cuando tu azÃºcar en la sangre es baja, tu cuerpo envÃ­a seÃ±ales que necesitas alimento. Diferentes personas tienen sÃ­ntomas diferentes; sin embargo los mÃ¡s comunes son: Sentirte dÃ©bil, mareado, tener hambre, temblores, sentirte delicado, sudar, tener latidos fuertes del corazÃ³n, empaledecimiento de piel o sentirte asustado o ansioso. Si presentas estos sÃ¬ntomas consultalo con tu mÃ©dico.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (51, 'mensaje conocimiento', 'SabÃ­as que la insulina es una hormona producida por el pÃ¡ncreas, que se encarga de regular la cantidad de glucosa de la sangre.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (52, 'mensaje conocimiento', 'SabÃ­as que las complicaciones crÃ³nicas de la Diabetes Mellitus se deben bÃ¡sicamente a un control insuficiente de las cifras de glucemia y a los aÃ±os de evoluciÃ³n de la enfermedad.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (53, 'mensaje conocimiento', 'SabÃ­as que una alimentaciÃ³n correcta puede ayudarte a alcanzar la normalidad bioquÃ­mica (glucemia y lÃ­pidos plasmÃ¡ticos), minimizar las fluctuaciones de glucemias posprandiales, conseguir y mantener el normopeso y contribuir a prevenir y tratar las complicaciones, tanto agudas como crÃ³nicas.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (54, 'mensaje conocimiento', 'SabÃ­as que la neuropatÃ­a diabÃ©tica; la afecciÃ³n mÃ¡s grave es la cardiovascular ya que se asocia a aumento de muerte sÃºbita, arritmias cardÃ­acas e isquemia miocÃ¡rdica silente. Son frecuentes tambiÃ©n los sÃ­ntomas gastrointestinales (gastroparesia, diarrea), genitourinarios (impotencia e incontinencia), hipotensiÃ³n ortostÃ¡tica, hipoglucemias inadvertidas y episodios de sudaciÃ³n gustativa.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (55, 'mensaje conocimiento', 'SabÃ­as que el pie diabÃ©tico; es la complicaciÃ³n de la Diabetes Mellitus con mayores implicaciones econÃ³micas y sobre la calidad de vida de los pacientes. Es casi siempre consecuencia de la pÃ©rdida de sensibilidad por neuropatÃ­a y la presencia de deformidades (pie de riesgo); el desencadenante mÃ¡s frecuente de las lesiones son los traumatismos debidos al calzado, que provocarÃ¡n la lesiÃ³n tisular y la apariciÃ³n de Ãºlceras.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (56, 'mensaje conocimiento', 'SabÃ­as que el edema macular es la causa mÃ¡s frecuente de incapacidad visual en los diabÃ©ticos tipo 2 (pÃ©rdida de visiÃ³n central).', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (57, 'mensaje conocimiento', 'SabÃ­as que hasta un 33% de los diabÃ©ticos tipo 2 presentan un grado de nefropatÃ­a diabÃ©tica. Esta complicaciÃ³n es un deterioro renal que se presenta de manera progresiva y que si no es tratada puede terminar en una insuficiencia renal.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (58, 'mensaje conocimiento', 'SabÃ­as que una de las complicaciones de la Diabetes Mellitus es la cardiopatÃ­a isquÃ©mica es la responsable del 75% de muertes en la Diabetes Mellitus 2.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (59, 'mensaje conocimiento', 'SabÃ¬as que una de las complicaciones de la Diabetes Mellitus es la arteriopatÃ­a perifÃ©rica que afecta a mÃ¡s del 20% de los diabÃ©ticos tipo 2. Su presencia aumenta el riesgo de amputaciÃ³n y muerte cardiovascular.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (60, 'mensaje conocimiento', 'SabÃ¬as que la prevalencia de Accidentes Cerebro Vasculares (ACV)  es mÃ¡s elevada entre los pacientes diabÃ©ticos (6%); sin embargo, no es una manifestaciÃ³n frecuente, posiblemente porque los pacientes diabÃ©ticos mueren antes por otras complicaciones.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (61, 'mensaje conocimiento', 'SabÃ­as que todos los pacientes con diabetes deben ver un oftalmÃ³logo anualmente para un examen de los ojos con las pupilas dilatadas. Los pacientes a los que se les conoce enfermedades de los ojos tales como sÃ­ntomas de visiÃ³n borrosa en un ojo o manchas ciegas pueden necesitar visitar a su oftlamÃ³logo mÃ¡s frecuentemente.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (62, 'mensaje conocimiento', 'SabÃ­as que debes realizarte un examen de orina debe cada aÃ±o. El chequeo regular de la presiÃ³n sanguÃ­nea es importante ya que el control de la hipertensiÃ³n (presiÃ³n alta de la sangre) es esencial en la disminuciÃ³n de las enfermedades renales.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (63, 'mensaje conocimiento', 'SabÃ­as que el adormecimiento o cosquilleo en tus pies debe ser reportado a tu doctor en tus visitas regulares. Debes chequear tus pies diariamente y ver si tienes enrojecimientos, callos,rajaduras o piel descompuesta. Si notas estos sÃ­ntomas antes del dÃ­a de tu visita, notifica a tu doctor inmediatamente.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (64, 'mensaje conocimiento', 'SabÃ­as que si tienes hipoglucemia puedes sentir sintomas tardios como:  ConfusiÃ³n, dolor de cabeza, irritabilidad, coordinaciÃ³n pobre, tener malos sueÃ±os o pesadillas, incapacidad de mantener en tu mente un tema, sentir adormecimiento de tu boca y lengua o desmayarte. Si tienes la presencia de estos sÃ¬ntomas consultalo con tu mÃ©dico.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (65, 'mensaje conocimiento', 'SabÃ­as  que debes reducir el consumo de alimentos fuentes en carbohidratos simples y de grasas saturadas y trans, sustituyendolas por grasas provenientes de pescados y de aceites vegetales como el de oliva o el de canola. ', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (66, 'mensaje conocimiento', 'SabÃ­as que debes aumentar el consumo de frutas y verduras como fuente de fribra y antioxidantes tomando en cuenta su contenido calÃ³rico.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (68, 'mensaje conocimiento', 'SabÃ­as que el consumo de dieta mediterrÃ¡nea puede disminuir el riesgo de ataque cerebrovascular, infarto agudo de miocardio y mortalidad.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (69, 'mensaje conocimiento', 'SabÃ­as que en tu dieta debe predominar el consumo de vegetales, hortalizas, legumbres, cereales integrales, frutas enteradas, frutos secos y aceite de oliva o nueces.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (70, 'mensaje conocimiento', 'SabÃ­as que tambiÃ©n debes incluir en tu dieta moderadamente el consumo de pescado, aves y productos lÃ¡cteos bajos en grasa. Y el consumo de carnes rojas, huevos y granos refinados debe ser esporÃ¡dico.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (71, 'mensaje conocimiento', 'SabÃ­as que las personas con Diabetes Mellitus 2 tienen un riesgo de dos a cuatro veces mayor de sufrir un evento coronario, en comparaciÃ³n de las personas sin diabetes.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (72, 'mensaje conocimiento', 'Buenos dÃ­as, que tu almuerzo el dÃ­a de hoy no contenga alimentos fritos y reemplazalos por asados o al vapor.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (73, 'mensaje conocimiento', 'Compra hoy y consume aceite de oliva, canola o girasol, asÃ­ protegerÃ¡s tu corazÃ³n de un infarto.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (74, 'mensaje conocimiento', 'Desde hoy retira el salero de la mesa, y disfruta del sabor natural de los alimentos.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (75, 'mensaje conocimiento', 'SabÃ­as que para condimentar los alimentos con hierbas puedes utilizar: orÃ©gano, albahaca, perejil, laurel, tomillo.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (76, 'mensaje conocimiento', 'Hoy cuando salgas a realizar una diligencia, camina, evita usar transporte pÃºblico, bÃ¡jate varias cuadras antes.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (77, 'mensaje conocimiento', 'SabÃ­as que el ejercicio hace parte de tu tratamiento, es una medicaciÃ³n segura y con muchos beneficios para tu salud.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (78, 'mensaje conocimiento', 'Antes de que inicies tu actividad fÃ­sica, comienza haciendo ejercicios de calentamiento moviendo los mÃºsculos y articulaciones en forma suave durante 5 a 10 minutos.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (79, 'mensaje conocimiento', 'SabÃ­as que el ejercicio libera sustancias quÃ­micas en el cerebro con efecto estimulante sobre tu estado de Ã¡nimo, reduciendo la ansiedad, el estrÃ©s y la depresiÃ³n.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (80, 'mensaje conocimiento', 'Si estÃ¡s en el trabajo o estÃ¡s en tu casa realizando tareas domÃ©sticas, pon mÃºsica para distraer tu mente y evitar que lo que hagas te agote.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (81, 'mensaje conocimiento', 'Cuando te enfrentes a un problema o situaciÃ³n difÃ­cil, respira profundo, esto ayudarÃ¡ a aclarar tu mente y obtener la mejor soluciÃ³n.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (82, 'mensaje conocimiento', 'Dedica un tiempo en el dÃ­a para ti, descansa en un sitio tranquilo, duerme lo necesario, es por tu salud.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (83, 'mensaje conocimiento', 'Expresa siempre tus preocupaciones y problemas, esto te permite desahogarte y ver todo mÃ¡s fÃ¡cil. ', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (84, 'mensaje conocimiento', 'Haz un calendario con las horas en las que tomas tus medicamentos todos los dÃ­as para que no olvides tomarte alguna dosis.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (85, 'mensaje conocimiento', 'Realiza una lista con los nombres de los medicamentos que consumes diariamente para que tengas un control de tu medicaciÃ³n y le ayudes a tu mÃ©dico en las consultas.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (86, 'mensaje conocimiento', 'SabÃ­as que cuando dejas de tomar una dosis de alguna pasta, pierdes el efecto de este medicamento y puedes estar en riesgo de descompensarte.', 'a');
INSERT INTO public.tipo_recurso (id_tipo_recurso, nombre_recurso, mensaje_notificacion, estado) VALUES (87, 'mensaje conocimiento', 'Tu compromiso el dÃ­a de hoy es tomar los medicamentos segÃºn la dosis y hora indicada por el mÃ©dico.', 'a');
